(69, '75 Tahun Indonesia Merdeka, menuju Indonesia Maju', '<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%;\"><span style=\"font-family: Arial, sans-serif; text-align: justify;\">Tujuh\r\n puluh lima tahun yang lalu, Proklamator Bangsa, Ir. Soekarno \r\nmendeklarasikan kemerdekaan Indonesia pada tanggal 17 Agustus\r\n1945. Kemerdekaan yang bukan diberikan sebagai hadiah, melainkan \r\nkemerdekaan\r\nyang diperoleh dengan penuh perjuangan darah, air mata, nyawa dan harta \r\nyang tak\r\nternilai harganya. Pembacaan naskah proklamasi oleh Ir. Soekarno \r\ndidampingi oleh Muhammad Hatta, merupakan momentum yang menandai \r\npernyataan\r\nsikap bangsa Indonesia untuk lepas dari belenggu penjajahan yang \r\nmenguasai\r\nnegeri ini.</span></p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><span style=\"font-family:\">Senin, 17 Agustus 2020, Indonesia\r\nmerayakan hari Kemerdekaannya. Sedikit berbeda dari tahun sebelumnya, karena\r\npada tahun ini Indonesia sedang dihadapkan dengan kondisi bencana nonalam,\r\npandemi COVID-19. Kondisi yang mempengaruhi banyak hal seperti kesehatan,\r\npsikologi, sosial, dan ekonomi masyarakat. Walaupun demikian semangat\r\nkemerdekaan tetap ada dalam diri setiap warga negara Indonesia. </span></p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><span style=\"font-family:\">Pada perayaan Hari Kemerdekaan\r\nRepublik Indonesia ke-75 ini, tema yang diangkat adalah Indonesia Maju. Tema\r\nyang merupakan wujud penggambaran dari Pancasila sebagai pedoman dalam\r\nkehidupan berbangsa dan bernegara. Tema yang diharapakan mampu memperkokoh\r\nkedaulatan , persatuan, dan kesatuan.</span></p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><span style=\"font-family:\">Indonesia\r\n Maju merupakan cita-cita bersama\r\nbangsa Indonesia. Mewujudkan makna kemerdekaan yang sesungguhnya. \r\nTentunya\r\nuntuk mewujudkan ini semua perlu perjuangan yang tidaklah mudah. Bangsa\r\nIndonesia harus menghadapi segala tantangan termasuk ujian pandemi \r\nCOVID-19\r\nini. Jika dahulu bangsa Indonesia harus berjuang melawan penjajah dengan\r\n senjata, saat ini pandemi COVID menjajah kita di segala\r\nbidang yang membuat dampak yang luar biasa hebat.  Tidak hanya nyawa \r\nyang menjadi korban, tetapi\r\njuga lapangan pekerjaan dan kegiatan perekonomian. Data Kementerian\r\nKesehatan tanggal 23 Agustus 2020, pandemi COVID-19 di Indonesia \r\nmencapai  153.535 kasus positif dan 6.680 orang meninggal dunia. </span></p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><span style=\"font-family:\">Sejumlah daerah di Indonesia saat ini  sudah memasuki Adaptasi\r\nKebiasaan Baru atau Kenormalan Baru dalam setiap aktifitasnya. Namun\r\nkondisi  yang belum membaik membuat\r\nkondisi perekonomian masyarakat belum normal seperti sebelum kondisi pandemi. Badan\r\nPusat Statisktik (BPS) menyebutkan bahwa pertumbuhan ekonomi Indonesia menurun\r\nsebesar -5,32 persen pada triwulan II tahun ini. Lalu apakah dengan kondisi yang demikian bangsa kita tetap\r\nmampu mewujudkan cita-cita Indonesia Maju?</span></p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><span style=\"font-family:\">Indonesia Maju akan terwujud jika\r\nseluruh elemen bangsa mau bersatu, optimis, dan percaya diri. Bangsa ini harus\r\nmemiliki semangat juang para pendiri bangsa dan meneladaninya. Semangat gotong\r\nroyong, kebersamaan, ketangguhan,dan kegigihan dalam berjuang menjadi modal\r\nbangsa untuk menggapai Indonesia Maju. Visi ini harus dijadikan landasan dalam\r\nsetiap langkah dan tindakan para pemangku kepentingan dalam menghadapi tantangan\r\nkeberlanjutan pembangunan bangsa.</span></p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><span style=\"font-family:\">Kondisi pandemi  bukanlah\r\nalasan penghambat terwujudnya cita-cita bangsa, melainkan merupakan momentum\r\nyang tepat untuk membenahi/memperbaiki sistem yang ada sebelumnya. Pandemi\r\nCOVID-19 hendaknya  menjadikan kita\r\nsemakin bersatu dalam keberagaman, gotong royong, tangguh dalam menghadapi\r\ntantangan, mendorong kecepatan, dan mewujudkan Indonesia Maju melalui\r\nIndonesia Sehat, Indonesia Bekerja, dan Indonesia Tumbuh.</span></p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><span style=\"font-family:\">Dirgahayu  Indonesiaku. Jayalah  bangsaku.</span></p>', '2021-10-25 02:10:21', NULL, 17, 'data:image/jpeg;base64,');
